(30, 1481, 1, 'هل يحق للشركة فصل موظف على مادة ٨٠ في بعد ارتكابة تعدي على المدير والزملاء  بعد حصوله على خطاب  فترة الاشعار بعدم الرغبة في تجديد العقد الذي بقي على نهايته ٦٠ يوم ووجود اشعار\r\n  ( طلب ) انتقال لكفيل آخر . ؟؟\r\nحيث لا يقبل معنا قبول الانهاء على مادة ٨٠ في نظام مقيم  \r\nوالسؤال هنا هل يحق لنا من الناحية القانونية والنظامية \r\n\r\nولكم جزيل الشكر', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-07-27 11:24:15', '2023-08-04 16:37:04', NULL),
(31, 1482, 1, '‏صدر حكم درجة أولى من محكمة الجزائية مدينة الخبر والمستائنف ضدي النايبة العامة وتم رفع اعتراض من النايبة وأنا كذلك تم رفع اعترراض وعند انقاد الجلسة \r\n‏تفاجأت بأن الحكم تأييد من الدرجة الأولى ولم يتم ادراجة محل الأستناف بنفس الدائرة المصدرة للحكم ما هو الإجراء النظامي والقانوني هل التقدم لدى المحكمة العليا او ارفع المذكرة إلى التواصل العدلي بهذا الشآن وشكرآ', 1, NULL, 0, NULL, 'السؤال غير واضح هل تقصد برفعك الاعتراض صدر مرة اخرى من المحكمة الابتدائية او صدر من الاستئناف وترغب الاعتراض عليه', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-07-27 12:15:38', '2023-08-07 17:43:11', NULL),
