(49, 1496, 1, 'سلام عليكم\r\nاساتذتنا الكرام\r\nشخص باع شقه عام١٤٣٦ الشقه مرهونه للبنك باعها بقيمة ٢٨٠ الف نهي تسوا ٦٠٠ الف وعلى حسب الاتفاق ان الشاري يعطي ١٨٠ الف والميه الباقيه بعد مايفرغ الشقه بسمه والبائع حصله تعثرات ماليه ولا قدر يسدد البنك ويبا يفسخ عقد الشقه \r\nمع العلم الشاري له ٨ سنين ماخذ الشقه من البائع \r\n\r\nالطلب البايع يبا يفسخ العقد \r\nهل هو ممكن؟؟', 1, NULL, 0, NULL, 'نعم يمكنه فسخ العقد لكن وفق اجراءات مزدوجة ضد المشتري ومع البنك', NULL, 2, 5084, 1, NULL, NULL, 1, 3, 15, 5084, 0, 1, 0, 0, NULL, '2023-08-07 19:02:03', '2023-08-20 15:18:47', NULL),
(50, 1497, 1, 'وافد تقدم لزواج بسعوديه . وقدم أوراقه للشرطه .ورفعت الاوراق للإمارة .\r\nجاه الرد من الاماره بمراجعة اداره الوافدين  . وجاه ايقاف خدمات من إدارة الوافدين  يبلغ بالمراجعة \r\n\r\nذهب كفيله الى الوافدين ليعرف سبب ايقاف الخدمات قالو السبب خروج العامل من المملكة بطريقه غير نظاميه قبل ١٢ سنه .  \r\nوطلبوا منه إحضار العامل \r\n\r\nلكي يقوموا بترحيله \r\n\r\nحاول معهم بكل الطرق رفع ايقاف الخدمات عن العامل ولاكنه ووجه بالرفض  \r\n \r\nهل يستطيع العامل او كفيله رفع قضيه على إدارة الوافدين ؟\r\n \r\nحيث انه الان  قد ترك موضوع الزواج . لا يريد الا رفع ايقاف الخدمات عن العامل فقط\r\n\r\nنرجوا من من لديه خبره في هذه القضيه التكرم علينا بالمشوره وجزاكم الله خير الجزاء', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-08-07 21:07:00', '2023-08-07 21:07:00', NULL),
