(52, 1500, 1, 'السلام عليكم انا واخوي اخذنا سيارة اقساط من شخص وقمنا ببيعها واقتسمنا قيمتها نقدًا انا المشتري وهو الكفيل والان باقي مبلغ حوالي 50 الف انا 25 وهو 25 انا ابغى اسدد كاش واتخارج من الاقساط والدائن موافقة ماهي الدعوى او الاثبات الي اخذه منه في المحكمة عشان معاد يطالبني فيه', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 8, 1546, 0, 1, 0, 0, NULL, '2023-08-08 09:21:10', '2023-08-17 15:37:47', NULL),
(53, 1501, 1, 'انا عندي بنت بعمر ال٧ واخذت نفقة فقط ٧٠٠ شاملة كل شي والآن بتدخل اولى ابتدائي والنفقة ماتكفي الاحتياج ومصاريف الدراسة ابغى ازيد نفقة واستفساري وش اكتب كلام لان ماعرف اعبر', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-08-08 10:23:39', '2023-08-17 15:37:13', '2023-08-17 15:37:13'),
(54, 1502, 1, 'انا عندي بنت بعمر ال٧ واخذت نفقة فقط ٧٠٠ شاملة كل شي والآن بتدخل اولى ابتدائي والنفقة ماتكفي الاحتياج ومصاريف الدراسة ابغى ازيد نفقة واستفساري وش اكتب كلام لان ماعرف اعبر', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-08-08 10:23:44', '2023-08-17 15:37:07', '2023-08-17 15:37:07'),
(55, 1503, 6, 'انا عندي بنت بعمر ال٧ واخذت نفقة فقط ٧٠٠ شاملة كل شي والآن بتدخل اولى ابتدائي والنفقة ماتكفي الاحتياج ومصاريف الدراسة ابغى ازيد نفقة واستفساري وش اكتب كلام لان ماعرف اعبر', 1, NULL, 0, NULL, '*رد الاستشارة*\r\n\r\nبسم الله الرحمن الرحيم والصلاة والسلام على من لا نبي بعده:\r\n\r\nيمكنك رفع دعوى زيادة نفقة والمطالبة بزيادة نفقة الصغير لكبر عمره  وزيادة مصاريفه  وسوف تحكم لكِ المحكمة بإذن الله.\r\n\r\nبخصوص الصياغة فليس شرط أن تكون صياغتك صياغة قانونية ولكن الصياغة القانونية افضل وانجز أمام القاضي وتجعل القاضي يتفاهم موقفك بسهولة، وننصح بالاستعانة بمحامي حيث أن ذلك افضل حل حتى يصيغ حجتك أمام القاضي ويرد على أي دفوع متوقعة من طليقك.\r\n\r\nيمكننا مساعدتك في هذا الأمر ورفع دعوى زيادة نفقة والحصول على نفقة مجزية للطفلة اكثر من ذلك بكثير.\r\n\r\nمع فائق الشكر والتقدير', NULL, 2, 976, 1, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-08-08 10:24:49', '2023-08-18 01:36:04', NULL),
(56, 1504, 1, 'أخي انمسك بالحملة ومع خوية مادة الحشيش صفر جرام والمركبة بأسم اخي والا الان بالسجن من تاريخ ١٠ /١٠ /١٤٤٤\r\n\r\n علماً بان اخي له ٣ سوابق فقط وتم اعفاءه \r\n وزميلة معترف فيها بس للان ماوصلو للقاضي .. \r\n\r\n مالاجراء المترتب علية', 1, NULL, 0, NULL, 'اذا اعترف صاحبه بان المادة المضبوطة له فلا شيء عليه واذا لم يعترف ستكون الادانة على اخوك صاحب المركبة وخصوصا ان لديه سوابق', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-08-08 12:38:16', '2023-08-19 11:49:22', NULL),
(57, 1505, 1, '‏السلام عليكم\r\n‏ناجز لايقبل دعوى اثبات طلاق التي تتقدم بها المقيمة بسبب انتهاء اقامتها، زوجها سعودي ، وطلقها وخرجت من العدة ويوجد شهود وتم رفعها عن طريق محامي وردت ايضا لذات ، اتمننى منكم افادتي عافاكم الله\r\n‏ولاتستطيع تجديد الاقامة بسبب ان زوجها لم ينقلها عل كفالته ولازالت تابع باقامة الاب وعليها غرامات تاخير وعلى ابيها ايضا', 1, NULL, 0, NULL, '*رد الاستشارة*\r\n\r\nبسم الله الرحمن الرحيم والصلاة والسلام على من لا نبي بعده:\r\n\r\nللأسف ناجز لا يقبل طلبات إثبات الطلاق إلا اذا كانت الاقامة سارية، يجب تجديد الإقامة للأسف من خلال تجديد إقامة الأب ومن ثم تجديد الكفالة.\r\n\r\nكما يمكنك الإتصال بهذا الرقم: 1950 وابلاغهم بأن لديكي مشكلة في أحد الخدمات الالكترونيه المقدمة على ناجز.\r\n\r\nكما يمكننا مساعدتك في هذا الأمر ومحاولة اثبات الطلاق امام المحكمة ورفع دعوى اثبات طلاق.\r\n\r\n\r\nمع فائق الشكر والتقدير', NULL, 2, 976, 1, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-08-09 06:38:51', '2023-08-18 01:31:32', NULL),
(58, 1506, 2, 'السلام عليكم\r\nصدر لي حكم تقريباً من ٣ سنوات بالنفقه وطلبت تنفيذ لكن تم ايقاف خدماته ولم استفد شي إلى الآن هل يوجد أي اجراء آخر اتخذه وهل ايقاف الخدمات مفعل إلى الآن', 1, NULL, 0, NULL, '*رد الاستشارة*\r\n\r\nبسم الله الرحمن الرحيم والصلاة والسلام على من لا نبي بعده: \r\n\r\n م\r\nطالما  لم يتم تنفيذ الحكم منذ ثلاث سنوات، فنري رفع جنحة الامتناع عن تسديد النفقة عليه وطلب حساب النفقة من جديد بأثر رجعي، ثم بعد ذلك التوجه من جديد الى محكمة التنفيذ.\r\nويمكننا مساعدتك بالأمر. \r\n\r\nمع فائق الاحترام والتقدير', NULL, 2, 976, 1, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-08-09 10:59:13', '2023-08-18 01:26:30', NULL),
(59, 1507, 1, 'هل  مركز المعلومات الوطني بوزارة الداخليه له الصلاحيه ان يزود زوجي بمكالمات جوالي ورسايلي ووسائل التواصل الاجتماعي الخاصه بي ؟؟\r\nعلما ان شريحة الجوال بسم والدي ليست باسمي ولا باسمه \r\nاتمنى التوضيح …', 1, NULL, 0, NULL, 'لا يحق له الدخول على مثل هذه المعلومات فلها خصوصية محمية بموجب النظام', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-08-09 12:14:01', '2023-08-19 11:50:13', NULL),
(60, 1508, 1, 'عملت شكوى ضد شركة تقدم ايجار شقق في مكة ولكنها لم  تفي  بالشروط وعملت شكوى عن طريق ناجز ، وحظرت الجلسة مع  الشيخ  ولم يحضر خصمي   ؟  وبعده  الجلسة  بشهر وصلتني  رساله من  ناجز  ان علي مبلغ مالي لابد من  دفعه  بسبب القضية  التي  خسرتها', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-08-10 05:38:44', '2023-08-17 15:32:35', NULL),
(61, 1509, 1, 'انا انفصلت وعندي ثلاثه اطفال وتزوجت برجل اخر واولادي عند اهل الاب وحالتهم سيئه جداً من ناحية التعليم والغذا والنوم وكل شي ابوهم مريض نفسي ولا يسال عنهم ابداً ولا يتم صرف ريال واحد عليهم الا من الضمان وحساب المواطن يعني اللي من الدوله فقط هل يمكنني اطالب باجرة السكن والنفقه واحضارهم  بسكن بجواري ؟', 1, NULL, 0, NULL, 'يمكن طلب ذلك ويكون من خلال طلب حضانة للأولاد بما أن حالتهم سيئة لدى الأب وأنه مريض نفسي فانتي أحق بحضانتهم، ويلحق طلب الحضانة بعد ذلك طلب النفقة لهم.', NULL, 2, 5080, 1, NULL, NULL, 1, 3, 15, 5080, 0, 1, 2, 0, NULL, '2023-08-11 09:09:13', '2023-09-07 13:57:51', NULL),
(62, 1510, 1, 'انا شاري بيت من شخص يدعى وضحا ووضحا ذي ماسددت قيمت  البيت من الي باعها الان الصك باسمي وانا ساكن هل يحقلهم انهم يسحبو البيت مني او يوقفون الصك', 1, NULL, 0, NULL, 'لكن كون صك البيت بإسمك لا يلحقك ضرر أو مطالبة بسداد الثمن .', NULL, 2, 5078, 1, NULL, NULL, 1, 3, 15, 5078, 0, 1, 0, 0, NULL, '2023-08-11 19:48:42', '2023-08-17 18:16:13', NULL),
(63, 1512, 1, 'طلب صاحب الهوية: ******9462\r\nنبلغكم بصدور أمر التنفيذ ضدكم بالرقم: 400344502124896 \r\n لطلب التنفيذ رقم: 401014501537323\r\nمن مصرف الانماء ضد فهد صالح سعيد باخريبه\r\nبتاريخ: 1445/01/22 هـ\r\nويلزمكم سداد مبلغ قدره 58960.00 ريال \r\nللفاتورة رقم: 23167061201\r\nوذلك عبر نظام سداد رقم المفوتر: 169 \r\nخلال خمسة أيام من تاريخ هذا التبليغ، وفي حالة عدم التنفيذ، ستطبق عليكم الإجراءات الواردة في نظام التنفيذ', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-08-11 21:36:54', '2023-08-11 21:36:54', NULL),
(64, 1513, 1, 'انا طالب تنفيذ في المحكمة بمبلغ 25 الف وتم سحب 23 الف من حساب المنفذ ضده وطلع عندي المتبقي 2000 ريال هل ال 23 الف اقدر اطلب تحويلها على حسابي', 1, NULL, 0, NULL, 'نعم ، بإرفاق الحساب البنكي لطالب التنفيذ شخصياً ويلزم مطابقة اسم صاحب الحساب البنكي بإسم طالب التنفيذ.', NULL, 2, 5083, 1, NULL, NULL, 1, 3, 15, 5083, 0, 1, 0, 0, NULL, '2023-08-12 19:20:30', '2023-08-19 08:18:17', NULL),
(65, 1514, 1, 'تم شطب القضية بسبب عدم حضوري الجلسة .. هل استطيع رفع الدعوى مره أخرى ؟ او هل هناك حل آخر ؟', 1, NULL, 0, NULL, 'يوجد حالتين:\r\n١- اذا لم يمضي ٦٠ يوم من تاريخ الشطب راجع الطلب واطلب اعادة النظر فالدعوى واعتذر عن عدم الحضور ستعيد الدائرة نظر الدعوى وتعطي موعد جديداً \r\n\r\n٢- لكن اذا مضت ٦٠ يوم ولم تراجع خلال المدة تصبح القضية ملغية يعني كأن لم يكن', NULL, 2, 5084, 1, NULL, NULL, 1, 3, 15, 5084, 0, 1, 0, 0, NULL, '2023-08-13 04:07:54', '2023-08-17 15:43:12', NULL),
(66, 1515, 1, 'رفعت دعوى في المحكمة على مؤسسة وكسبت الحكم ولما كنت ابي ارفع الدعوى بالتنفيذ رفض لان المؤسسة مشطوبه في هذا الحالة ماهو الاجراءات المناسب لرفع الدعوى للعلم ان ذمة المؤسسة من ذمة صاحب المؤسسة', 1, NULL, 0, NULL, 'ترفع الدعوى على مالك المؤسسة بشخصه لان المؤسسات ليس لها ذمة ماليه مستقلة وإنما تدخل في ضمن ذمة صاحبها', NULL, 2, 5095, 0, NULL, NULL, 1, 3, 15, 5097, 0, 1, 0, 0, NULL, '2023-08-15 13:10:30', '2023-09-03 14:51:13', NULL),
(67, 1516, 1, 'بيني وبين زوجي مشاكل وعندي صك حضانه لاطفالي باني مسئوله عنهم وعن اوراقهم الرسميه والسفر لخارج المملكه يكون بامر من القاضي \r\n\r\nوالان زوجي يقول بسفر عيالي نهائي بدوني مين لهم باليمن مايعرفون احد \r\nهل بموجب صك الحضانه اقدر امنعهم من السفر', 1, NULL, 0, NULL, 'نعم، يمكنك منع ذلك كونك الحاضن لهم.', NULL, 2, 5098, 1, NULL, NULL, 1, 3, 15, 5098, 0, 1, 0, 0, NULL, '2023-08-16 10:59:18', '2023-09-04 10:38:23', NULL),
