(101, 1558, 1, 'السلام عليكم ورحمة الله وبركاته \r\n\r\nانا متزوجه لي ست شهور و طلبت الطلاق من زوجي بسبب سوء العشره معه وعدم احترامي والصراخ علي امام الناس بالاضافه لوجود ضعف لديه ولا يستطيع اعطائي حقي الشرعي وقد طلبت منه الذهاب للمستشفى للعلاج ورفض ان يطلق الا ان ارجع المهر له كامل في هذه الحاله هل ارجع له المهر  كامل', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-09-21 13:18:38', '2023-09-21 13:18:38', NULL),
