(105, 1559, 1, 'السلام عليكم شفتلكم منشور ان الاستشارات مجانية فإذا كان كذلك فاسفساري هو \r\nنحن مؤسسة وبينا وبين شركة نقل نزاع على عدم ايصال شحنات ومبلغ النزاع ٦٠ الف ماهي المحكمة المختصة \r\nوشكرا لكم ومبادرة جميلة وفقكم الله ورعاكم', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-09-22 18:23:22', '2023-09-22 18:23:22', NULL),
(106, 1560, 1, 'السلام عليكم ورحمة الله وبركاته وبعد.. \r\n\r\n\r\nالاستشارة:\r\n\r\nنحنُ ورثة مقيمين بالسعودية كان والدنا رحمه الله يملك مؤسسة قام بتسجيلها باسم شخص سعودي (يصرف له راتب مقابل اسمه)  وتوفي والدنا رحمه الله وقام عمي بالاشراف على هذه المؤسسة وذلك حتى شهر رمضان سنة ١٤٤٢ بعد اعلان وزارة التجارة حملة تصحيح التستر التجاري قام عمي ومالك المؤسسة الصوري بالافصاح التجاري لدى مكتب محاماة وتم تحويل المؤسسة إلى شركة ذات مسؤوليه محدودة بنسبة ٢٠٪؜ لعمي و ٨٠٪؜ للمالك الصوري واخراجنا من الموضوع بشكل كامل رغم ان ملكية المؤسسة الحقيقية تعود لوالدي فقط ، قمنا خلال هذه السنتين بمحاولات معهم لارجاع الحق الا اننا واجهنا رفض منهم ويقولون لنا اذهبوا واشتكوا للقضاء .. السؤال / ما هو تكييف القضية ونوعها هل هي جنائية ام تجاريه ام حقوقيه؟ وماهو تصنيف القضية في ناجز ؟ \r\n\r\nجزاكم الله خيراً وبارك لكم في علمكم وعملكم', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-09-23 03:14:39', '2023-09-23 03:14:39', NULL),
(107, 1561, 1, 'صك عقاري صدر فيه قرار من محكمة الاستئناف \r\nولا اعلم ما المقصود من القرار ، إذ ان الصك لم يتم نقضه .\r\nحيث ان حالة الصك في ناجز غير فعال. \r\nالسؤال الاول /ما ذا يترتب على الصك الغير فعال ؟ \r\nالسؤال الثاني / هل هذا القرار يلغي حق الانتفاع أو لي الحق في استعماله واستغلاله والانتفاع فيه ، إذ إن في الصك منشآت تجارية ورخص وعليها مشاريع مؤجرة وسكن خاص ومزرعة ؟\r\nالسؤال الاخير / ماهو النص النظام الذي يحكم وينظم هذا النوع من القضايا \r\n\r\nوبارك الله فيكم وجزاكم الله عنا خير الجزاء', 1, '2ab243bac440aff7112de7da849ea3f2.jpeg', 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-09-23 07:05:41', '2023-09-23 07:05:41', NULL),
(108, 1562, 1, 'السلام عليكم \r\nلدي قضية بديوان المظالم بطلب التعويض عن قرار التثبيت لكونه مخالف للنظام حيث تم تثبيتي عام 1433 على مرتبة اقل ودرجة اقل من المحددة لمؤهلي في دليل تصنيف المؤهلات العلمية\r\nوقد تم رفض الدعوى وكذلك الاستئناف ايد الحكم\r\nاحتاج استشارة عاجلة \r\nهل يكون هناك اعتراض على حكم الاستئناف امام الاستئناف ام يلزم الرفع للمحكمة الإدارية العليا\r\nوهل من الممكن التواصل بشكل مباشر مع مختص قانوني في القضايا الادارية', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-09-25 04:30:05', '2023-09-25 04:30:05', NULL),
(109, 1563, 1, '‏السلام عليكم…. عندي قضية منظورة في المحكمة الادارية العليا…. بعد رفض الدعوة من ديوان المظالم والاستئناف،،، السؤال: هل اقدر استعين بمحامي ؟؟ وآمل بتوجيهي بمحام له خبرة في القضايا الادارية وخاصة الترقيات', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-09-26 04:32:16', '2023-09-26 04:32:16', NULL),
