(112, 1566, 1, 'السلام عليكم استفساري بخصوص عقد تم توقيعه على اساس انه دين مع العمولة ويوجد بند موضح انه في حال التاخر عن السداد سيتم طلب مبلغ ١١٠٠٠ من اصل الدين كعمولة لكن عند التاخر تم الاتفاق شفهيا مع الدائن وسؤاله اذا يمكن تاخيره او دفع نصف القسط واخبر المدين انه لا بأس ويمكن له ان يتاخر والان بعد سداد كامل الدين منذ شهر طلب مني الان نصف مبلغ ال ١١٠٠٠ فهل يحق له المطالبه بالغرامة بعد تسديد الدين والانتهاء منه؟تم ارفاق صورة من العقد ارجوكم الرد باسرع وقت', 1, '2c7e7bd87304384cf9d987a1a8415545.jpeg', 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-10-03 04:54:09', '2023-10-03 04:54:09', NULL),
