INSERT INTO `contents` (`id`, `type`, `Title`, `details`, `created_at`, `section`, `Image`, `updated_at`, `deleted_at`, `second_image`) VALUES
(1, NULL, 'من نحن', '<p>- منصة يمتاز الإلكترونية</p>\n<p>- دليلك المبتكر إلى عالم المهن والخدمات الاستشارية والقانونية</p>\n<p>- بادر لحجز مكتبك الإلكتروني فوراً</p>\n<p>- نخدمكم على مدار الساعة</p>\n<p>&nbsp;</p>\n<p>* طريقة الاشتراك :</p>\n<p>الحصول على عضوية منصة يمتاز الإلكتورنية للخدمات الاستشارية القانونية مجاني ودون أي رسوم، وسيحصل عضو المنصة (مقدم الخدمة) على ظهور مجاني في صفحة الدليل الرقمي طيلة فترة انضمامه للمنصة .</p>\n<p>&nbsp;</p>\n<p>* ما معنى مقدم الخدمة ؟</p>\n<p>مقدم الخدمة هو المهني صاحب الاختصاص كالمحامي المرخص والمستشار القانوني والممثل النظامي والوكيل الشرعي والمسوق القانوني والموثق والمدرب القانوني والباحث القانوني والمحامي المتدرب ...</p>\n<p>إلى آخر المهن التي يتم استحداثها في المنصة وفق الأنظمة المعتبرة ومتطلبات سوق العمل .</p>\n<p>&nbsp;</p>\n<p>* كيفية التسجيل كمقدم خدمة ؟</p>\n<p>عبر هذا الرابط :&nbsp;<a href=\"https://ymtaz.sa/lawyer/sign-in/form\">التسجيل في منصة يمتاز (ymtaz.sa)</a>&nbsp;</p>', '2021-09-05 22:00:00', 1, 'contents/January2022/z3jwJC34j3YBU7FzYWX9.png', '2022-01-14 12:10:49', NULL, 'contents/January2022/s2eGzjFlz0lzWAJDPSzN.png'),
(2, NULL, 'الرؤية', '<p>جيل من الشباب السعودي الطامح لمعانقة الإنجاز بلغة عصرية متوثبة وهمة وطنية رائدة .</p>', '2021-09-05 22:00:00', 2, 'contents/January2022/PcDJk2cpNB4FDtMpV2fG.png', '2022-01-14 12:24:52', NULL, 'contents/January2022/6OCa4OaZ8xnO7eLBVruj.png'),
(3, NULL, 'الرسالة', '<p>نتقدم للأمام، ونسعى للأفضل (تعلمنا لنعين)</p>\r\n<p>انضم اليوم لجيل من الشباب الطموح، ضمن عشرات المهن الاستشارية تحت سقف ريادي فسيح .</p>\r\n<p>شركة يمتاز للمحاماة والاستشارات القانونية - شركة مهنية سعودية ذات مسؤولية محدودة</p>', '2021-09-05 22:00:00', 3, 'contents/January2022/Xjnk7IiTa0EKGaek3SXB.png', '2022-01-14 12:23:53', NULL, 'contents/January2022/ZabXffIttPxizv9Q2j6X.png'),
(4, NULL, '* طريقة الاشتراك ', '<p style=\"box-sizing: border-box; margin: 0px 0px 1rem; padding: 0px; border: none; outline: none; position: relative; line-height: 1.8em; color: #333333; font-size: 16px; font-family: \'Tajawal Regular\'; text-align: right;\">الحصول على عضوية منصة يمتاز الإلكترونية للخدمات الاستشارية القانونية هو انضمام مجاني ودون أي رسوم، وسيحصل عضو المنصة (مقدم الخدمة) على ظهور مجاني في صفحة الدليل الرقمي طيلة فترة انضمامه للمنصّة .</p>', '2022-01-14 12:07:24', 4, 'contents/January2022/aPGghQQRo2wvSmmLzdqx.png', '2022-01-14 12:25:43', NULL, 'contents/January2022/vrI8qhCeJqpxVRjbekbo.png'),
(5, 'lawyersrules', 'سياسة خصوصية المحامي', '<ul><li>&nbsp;منصة يمتاز الإلكترونية</li></ul><p>- دليلك المبتكر إلى عالم المهن والخدمات الاستشارية والقانونية.</p><p>&nbsp;</p><ul><li>&nbsp;طريقة الاشتراك :</li></ul><p>الحصول على عضوية منصة يمتاز الإلكترونية للخدمات الاستشارية القانونية مجاني ودون أي رسوم، وسيحصل عضو المنصة (مقدم الخدمة) على ظهور مجاني في صفحة الدليل الرقمي طيلة فترة انضمامه للمنصة وفق الشروط والقواعد المتبعة .</p><p>&nbsp;</p><ul><li>&nbsp;ما معنى مقدم الخدمة ؟</li></ul><p>- مقدم الخدمة هو المهني صاحب الاختصاص كالمحامي المرخص والمستشار القانوني والممثل النظامي والوكيل الشرعي والموثق والمدرب القانوني والباحث القانوني والمحامي المتدرب .</p><p>إلى آخر المهن التي يتم استحداثها في المنصة وفق الأنظمة المعتبرة ومتطلبات سوق العمل .</p><p>&nbsp;</p><ul><li>ما هي المهن التي تقبلها المنصة ؟</li><li>ترحب المنصة باقتراح أي مهنة جديدة لا تخرج عن الإطار العام لنشاط المنصة متى كانت متاحة نظاماً وتتوافق مع متطلبات سوق العمل .</li></ul><p>&nbsp;</p><p>* كيفية التسجيل كمقدم خدمة ؟</p><p>عبر هذا الرابط :&nbsp;<a href=\"https://ymtaz.sa/lawyer/sign-in/form\">التسجيل في منصة يمتاز (ymtaz.sa)</a>&nbsp;</p><p>&nbsp;</p><ul><li>شروط الالتحاق بالمنصة ؟</li><li>أن يتعهد المتقدم بأن المعلومات المقدمة للمنصة صحيحة نظاماً وللمنصة سلوك كل السبل النظامية للتأكد من ذلك بما فيها طلب نسخة من هوية المتقدم عند التسجيل .</li><li>أن يدون مقدم الخدمة رقم الترخيص ونسخة من الترخيص في كل مهنة يتطلب النظام وجود ترخيص لمزاولتها .</li><li>للمنصة تعليق أي عضوية من الظهور عند وجود أي ملاحظة ودون مبررات وفق ما تراه إدارة المنصة .</li><li>للعضو طلب تعليق عضويته عند الحاجة متى أراد بمراسلة المنصة عبر أيقونة اتصل بنا .</li><li>على المتقدم أن يكون تعامله مع العملاء بكل احترافية وأمانة وفق الضوابط واللوائح المنظمة لهذه العلاقة .</li><li>تتعهد المنصة بالمحافظة على خصوصية عملائها ومقدمي الخدمة لديها وتضمن عدم الوصول للوثائق أو المعلومات وفق الأنظمة والتعليمات المنظمة لذلك.</li></ul><p>- ملحوظة : عند وجود أي تحديثات أو إضافات على هذه البنود فسيتم تحديث هذا الميثاق وعرضه على كافة مقدمي الخدمة للتوقيع عليه .</p><p>والله الموفق .</p>', '2021-09-05 22:00:00', 1, 'contents/January2022/z3jwJC34j3YBU7FzYWX9.png', '2023-07-22 16:23:45', NULL, 'contents/January2022/s2eGzjFlz0lzWAJDPSzN.png');
