(5116, 'عطاالله', 'سعد', 'عطاالله', 'الدويخ', 'عطاالله سعد عطاالله الدويخ', NULL, NULL, 'atallahsaadalduwaikh@gmail.com', '$2y$10$VSIgg4vr3ntaui6ibDdVhegPtEJfM1pJWH9MZ6yK7B73qICNYm.zK', 'Male', 2, NULL, '0541369956', 'من خلال أساس أكاديمي متين يشمل الجمع بين درجة البكالوريوس في الدراسات القضائية ودرجة الماجستير في علم الجريمة ، فأني أمتلك مزيجًا فريدًا من الخبرة في كل من الجوانب القانونية والجنائية لنظام العدالة الجنائية. حيث تمكّنني هذه الخلفية متعددة التخصصات من التنقل في تعقيدات نظام العدالة ، وتحليل القضايا القانونية بشكل نقدي ، واقتراح حلول قائمة على الأدلة لمواجهة التحديات المتعلقة بالجريمة. من خلال استخدام منهجيات البحث والتحليل الإحصائي والاستدلال القانوني وأيضًا توليد رؤى ذات مغزى وصياغة حجج راسخة ، تُمكنُني من ربط النظرية بالممارسة على أرض الواقع.', NULL, '0', 0, 0, 0, 1, NULL, NULL, 'عطاالله سعد عطاالله الدويخ', NULL, NULL, 0, 0, 0, 0, NULL, NULL, 1, NULL, NULL, 0, 0, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, '2023-09-24 10:48:18', '2023-09-24 10:48:18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 6, 2, NULL, NULL, 0, NULL),
