INSERT INTO `packages` (`id`, `title`, `intro`, `price`, `period`, `rules`, `created_at`, `updated_at`, `deleted_at`) VALUES
(3, 'باقة المكتب الإلكتروني', '<p>ملحوظة : قيمة الاشتراك السنوي بالمكتب الإلكتروني الشامل (5475) ريالاً يخصم منها 33% لتصبح بقيمة (3650) ريالاً وذلك لأول 30 مشترك حتى تاريخ 1-1-2023م أيهما أسبق</p>\r\n<p>مزايا الباقة :</p>\r\n<p>- اشتراك لمدة عام بباقة المكتب الإلكتروني الشاملة</p>\r\n<p>- اشتراك ضمني لمدة عام بباقة الدليل الرقمي</p>\r\n<p>- دعم فني على مدار العام</p>\r\n<p>- خصم دائم بباقة هيئة المستشارين يصل إلى 50% على قيمة الاشتشارات المتخصصة</p>\r\n<p>- خصم خاص بباقة الدروات القانونية التي تعلن عنها المنصة</p>\r\n<p>- رابط صفحة خاصة بالعميل تمكنه من التواصل مع عملائه بشعاره الخاص وإشهار اسمه بشكل مستقل</p>', 3650, 365, '- يلزم الموافقة على كافة الشروط والأحكام المتعلقة بوثيقة العمل في المنصة للاستفادة من خدماتنا .\r\n- بعث كافة بيانات صاحب الطلب بصيغة الـ PDF على واتساب الاشتراكات السعودي : 00966501754070\r\n- انتظار رسالة على الإيميل أو الواتساب بتأكيد القبول .', '2022-09-22 09:53:11', '2022-11-19 14:27:03', NULL);
