(1, 'استشارة قانونية', 'January2022/Pg8bccvJWBDXXUV8Tvas.png', 'خدمة الاستشارة القانونية العاجلة والدقيقة، للأفراد والمؤسسات والشركات بمختلف التخصصات القضائية والقانونية والشرعية .', '.', 'تمثيل-نظامي', 1, 100, 10000, '1,2,5,6,9,10,11,12,14,24,27,28', 500, 1, '2021-11-08 11:31:00', '2023-07-18 16:18:03', NULL),
(2, 'طلب تنفيذ', 'January2022/FsZSSQnfuvdJliBSxImi.png', 'متخصصون في خدمات التنفيذ بمختلف محاكم التنفيذ بالمملكة العربية السعودية .', NULL, 'طلب-تنفيذ', 1, 100, 10000, '1,2,5,6,9,10,11,14,24,27,28', 500, 1, '2021-11-08 11:53:00', '2022-11-26 00:26:34', NULL),
(3, 'توكيل محام', 'January2022/ByxThXPFhrkVuqevJlpD.png', 'تقدم المنصة خدمة التوكيل النظامي للأفراد والمؤسسات والشركات وتفاصيل هذا التوكيل وترشيح الانسب لهذا الاختيار .', '- وكالات الأفراد .\r\n- وكالات المؤسسات والشركات .\r\n- التوكيل لغير المواطنين .\r\n- وكالات الورثة .', 'توكيل-محام', 5, 100, 100000, '1,2,27', 500, 1, '2021-11-08 12:06:00', '2023-07-18 16:11:58', NULL),
(4, 'تدقيق العقود', 'January2022/olQjNFeiDXxcwQWsS00L.png', 'خدمة تدقيق وصياغة العقود الخاصة والعامة للأفراد والمؤسسات والشركات باللغتين العربية والإنجليزية .', '.', 'تدقيق-العقود', 4, 500, 500, '1,5,6,9,10,14,27,28', 500, 1, '2021-11-10 02:56:00', '2023-07-15 09:12:12', NULL),
(6, 'رفع دعوى', 'January2022/b3rAX2q804XZgo8rJiXh.png', 'خدمة رفع دعوى بتحديد المحكمة المختصة والنظام المناسب لها ودراسة نسبة نجاح الدعوى وتكاليفها القضائية .', 'خدمة رفع دعوى بتحديد المحكمة المختصة والنظام المناسب لها ودراسة نسبة نجاح الدعوى وتكاليفها القضائية .', 'رفع_دعوى', 1, 100, 1000, '1,2,3,5,6,9,10,11,14,24,27,28', 500, 1, '2021-11-12 02:03:00', '2023-07-18 16:07:07', NULL),
(7, 'تأسيس شركات', 'January2022/xBPTQctDDTPEGyTTTGix.png', 'متخصصون في تأسيس الشركات، وعقدها، وتصحيح أوضاعها، ومتطلباتها، والحماية الجنائية الكاملة للأنشطة التجارية .', '.', 'تأسيس-شركات', 1, 500, 100000, '1,6,10,27', 500, 1, '2021-12-25 10:18:00', '2023-07-18 16:14:39', NULL),
(8, 'عقد دورة', 'August2022/KcIfWyBE5RxI4T5FWZPR.jpg', 'فريق من المدربين المتخصصين بمختلف التخصصات القانونية الدقيقة في خدمتكم .', '.', 'عقد_دورة', 28, 500, 5000, '1,2,3,4,6,8,9,10,12,13,14,15,28', 500, 1, '2022-08-13 16:09:00', '2023-07-18 16:21:02', NULL),
(9, 'ترافع قضائي', 'November2022/P2uZ4ozesPaK1INibhrV.png', 'خدمة الترافع القضائي عن أحد أطراف الدعوى، حضورياً أو عن بعد، بمختلف مناطق المملكة .', '.', 'ترافع_قضائي', 1, 500, 10000, '1,14,24', 500, 1, '2022-11-02 08:15:00', '2023-07-18 16:22:13', NULL),
(10, 'ترجمة قانونية', 'November2022/89zkUNYcpt8oBoJZCARR.png', 'خدمة الترجمة القانونية المعتمدة للعقود والتقارير والوثائق بمختلف مناطق المملكة .', '.', 'ترجمة_قانونية', 9, 500, 10000, '13', 500, 1, '2022-11-02 15:21:53', '2023-07-18 16:23:25', NULL),
(17, 'تمثيل نظامي', 'November2022/GNKCIBYhPcdRzJECSBM6.png', 'خدمة التمثيل النظامي للأفراد والشركات والمؤسسات، بشكل دائم أو مؤقت .', '.', 'استشارة_قانونية', NULL, 500, 100000, '1,6,9,27,28', 500, 1, '2022-11-19 21:53:39', '2023-07-18 16:19:41', NULL),
(18, 'الملكية الفكرية', 'af2333f5764dcfb68366a1eba23d57bc.jpg', 'خدمات أنظمة الملكية الفكرية وفق الأنظمة السعودية .', '.', NULL, NULL, 500, 100000, NULL, 500, 1, '2023-07-15 09:08:32', '2023-07-18 16:24:42', NULL),
(19, 'أخرى', 'a0229ad587e3cae01bf6a85cae83012d.png', 'أي خدمة قانونية أخرى، يسعدنا فيها خدمتك .', '.', NULL, NULL, 49, 5000, NULL, 500, 0, '2023-07-26 17:37:33', '2023-08-04 16:29:34', NULL),
(20, 'خدمة التوثيق', 'b7d9abd2a50b9dc19cf9cb318e1589b9.png', 'خدمة التوثيق (إنشاء وكالة - الإفراغ العقاري - توثيق عقود - فسخ وكالة - الرهن العقاري - الإقرارات المالية) .', '.', NULL, NULL, 50, 10000, NULL, 500, 1, '2023-08-04 16:23:44', '2023-08-04 16:23:44', NULL),
(21, 'طلب تحكيم', '5a6b3667c5642655e352f0c8d87126b8.png', 'طلب محكم بمختلف التخصصات التي تتطلبها أنواع العقود .', '.', NULL, NULL, 500, 50000, NULL, 500, 1, '2023-08-04 16:26:15', '2023-08-04 16:26:15', NULL),
